import React from 'react';

function VideoOutput (props) {
  return (
    <div className="video">
      <div className="videoList">
        <div className="image">{props.videoImage}</div>
        <div className="name">{props.videoName}</div>
        <div className="chanel">{props.videoTittle}</div>
      </div>
    </div>
  )
}

export default VideoOutput
